import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let crnDate = new Date();
crnDate = crnDate.getHours();
let greeding = "";

if (crnDate >= 1 && crnDate < 11 ) {
  greeding = "Good Morning";
}else if (crnDate >= 12 && crnDate < 19 ){
  greeding = "Good Afternon";
}else{
  greeding = "Good Night";

}

ReactDOM.render(
  <>
  <h1>Hello, {greeding} </h1>
  </>,

  document.getElementById("root")
